                                        <li  className={classes.correct} >{ans.name}</li> 
                            </CardContent>
                        </Card>

                    ) :(

                        <Card  className= {classes.listResults}>
                            <CardContent className= {classes.listResults}>
                                <li  className={classes.blank} key = {index}>Country number {index+1}</li>
                            </CardContent>
                        </Card>

                        )
                         })}
            </Container>  
        </React.Fragment>
    );
};

export default Results
